import React from 'react'

const Dome = (props: any) => {
  return (
    <defs>
      <clipPath clipPathUnits="objectBoundingBox" id={props.type}>
        <rect x="-5.8761e-9" y="227.26" width="93.171" height="67.469" rx="46.113" ry="33.734" stroke-width=".25989"/>
        <rect x="1.1564e-6" y="263.17" width="93.36" height="34.018" rx="0" ry="0" stroke-width=".29919"/>
      </clipPath>
    </defs>
  )
}

export default Dome;
